// Pages/Contact.js
import React from "react";
import "../components/App.css";

const Contact = () => {
    const contactDetails = [
        { label: "Phone", value: "+90 9878987898" },
        { label: "Email", value: "student@iiitb.com" },
        { label: "Address", value: "123 University Road, City, Country" },
        { label: "Working Hours", value: "Mon-Fri: 9 AM - 5 PM" },
    ];

    return (
        <div className="contact-page">
            <h2>Contact Us</h2>
            <p>
                We are here to assist you. Feel free to reach out to us through any of the
                following contact details.
            </p>
            <div className="contact-details">
                {contactDetails.map((detail, index) => (
                    <div key={index} className="contact-item">
                        <strong>{detail.label}:</strong> {detail.value}
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Contact;
